// import logo from './logo.svg';
// import './App.css';
import {BrowserRouter as Router, Route, Link, Switch} from 'react-router-dom'
import Home from './components/Home';
import Global from './Styles/Global';

const App = () => {
  return (
    <Router>
      <Global>
        <Switch>
          <Route exact path="/">
            <Home/>
          </Route>
          <Route exact path="/rules">
            <p>LES REGLES</p>
          </Route>
        </Switch>
      </Global>
    </Router>
  );
}

export default App;
